import ImageList from "../components/ImageList";

const FavoritesPage = ({ favs }) => {
  return (
    <div className="p-8">
      <h1 className="text-3xl font-bold mb-6">Your Favorites</h1>

      <ImageList images={favs} />
    </div>
  );
};

export default FavoritesPage;
